import React from 'react'
import PropTypes from 'prop-types'
import axios from 'axios'




class City extends React.Component {

    constructor(props) {
        super(props);
        // this.state = {date: new Date()};
    }


    componentDidMount() {
        axios.get(`http://localhost:3000/globeData/${this.props.match.params.id}`).then(res => {
            this.props.paragraphs = res.data.paragraphs
            this.props.images = res.data.images
            this.props.popularity = res.data.popularity
            this.props.country = res.data.country
        }).catch(err => alert(err))
    }

    render() {
        // console.log(this.props.match)
        return (this.props.match.params.id)
    }
    // return <h3>Requested Param: {match.params.id}</h3>;
}

City.propTypes = {
    match: PropTypes.object.isRequired,
    paragraphs: PropTypes.arrayOf(
        PropTypes.string.isRequired
    ).isRequired,
    images: PropTypes.arrayOf(
        PropTypes.string.isRequired
    ).isRequired,
    popularity: PropTypes.number.isRequired,
    country: PropTypes.string.isRequired
}


export default City
